import React from "react";
import NavBar from "./navbar";
import { Link } from "react-router-dom";
import { useLocation } from 'react-router-dom';
import { businesses } from './apiService';
import './events.css'

function Events() {
  const location = useLocation();
  const data = location.state?.data;

  // Extract the first item from the data.businesses array
  const firstEvent = data?.businesses[0];

  return (
    <div>
        <NavBar />
        <h1>Events</h1>
        <div> {/* Ensure this div properly wraps the content below */}
          {/* Render your data here */}
          {data ? (
            <div>
              <ul>
                {data.businesses.map((item, index) => (
                  <li key={index}>{JSON.stringify(item)}</li>
                ))}
              </ul>
            </div>
          ) : null}
        </div> {/* Correctly closing the div started after <h1> */}
    </div>
  );
}


export default Events;
